import { useState } from "react";
import MealCounter from "./MealCounter";

function MealList(props) {
  const meals = ["pizza", "salad", "soup"];

  return (
    <div>
      <h3>{props.meal}</h3>
      <button>Finish</button>
      <MealCounter remaining={meals.length} />
    </div>
  );
}

export default MealList;
